import React from 'react'
import styled from 'styled-components'

import { ReactComponent as Tab } from '../../src/assets/svg/intersect.svg'

import { FiHome, FiUsers, FiUser } from 'react-icons/fi'

export const ContainerTab = styled.span`
  z-index: 9999;
  position: fixed;
  bottom: 0;
  display: flex;
  align-items: center;
  width: 100%;
`

export const TabBar = styled(Tab)`
  width: 100%;
`

export const ButtonHome = styled(FiHome)`
  height: 3rem;
  width: 3rem;
  display: inline-block;
  margin: auto;
  z-index: 5;
`

export const ButtonUser = styled(FiHome)`
  height: 3rem;
  width: 3rem;
  display: inline-block;
  margin: auto;
  z-index: 5;
`
export const ButtonTeam = styled(FiHome)`
  height: 3rem;
  width: 3rem;
  display: inline-block;
  margin: auto;
  z-index: 5;
`
